$(".mobilemenu").prepend(mobile_menu_html);
$(function () {
	$(".mobilemenu").find('ul').each(function() {

		// Collapse the entire menu
		$(this).css('display', 'none');

		// Register a click and fold out the menu
		$(this).prev('img').click(function(evt) {
			evt.stopPropagation();

			var next_ul = $(this).next('ul');
			if (next_ul.css('display') == 'none') {
				if ($(this).hasClass('invert')) {
					$(this).attr('src', '/static/icon/font/awesome/minus_ffffff.svg');
				} else {
					$(this).attr('src', '/static/icon/font/awesome/minus.svg');
				}
			}
			else {
				if ($(this).hasClass('invert')) {
					$(this).attr('src', '/static/icon/font/awesome/plus_ffffff.svg');
				} else {
					$(this).attr('src', '/static/icon/font/awesome/plus.svg');
				}
			}

			next_ul.slideToggle(100);
		});

		// Click the bottom_menu menu-text to fold
		$(this).closest('.bottom_menu').click(function(evt) {
			evt.stopPropagation();

			var next_ul = $(this).first().children('ul');
			var img = $(this).first().children('img');

			if (next_ul.css('display') == 'none') {
				img.attr('src', '/static/icon/font/awesome/minus.svg');
			}
			else {
				img.attr('src', '/static/icon/font/awesome/plus.svg');
			}

			next_ul.slideToggle(100);
		});
	});

	if (find != undefined) {

		// Locate the category we want to show.
		if ($('li[data-id=' + find + ']').length > 0) {

			//selected
			var fold_obj = $(".mobilemenu").find('li[data-id=' + find + ']');
			fold_obj.addClass("selected");
			fold_obj = fold_obj.parent('ul');

			while (fold_obj != undefined) {
				// If we hit the top level, then no more looping
				if (fold_obj.hasClass('mobilemenu')) {
					break;
				}

				// Expand the current menu and find the next
				fold_obj.css('display', 'block');
				// Fix the expand-icons for the expanded menus
				fold_obj.parent('li').find('>img').attr('src', '/static/icon/font/awesome/minus.svg');

				fold_obj = fold_obj.parent().closest('ul');
			}
		}
	}
});
function toggle_mobile_menu() {
	var mobile_menu = $('.mobilemenu');
	var mobile_veil = $('#mobilemenu_veil');
	if (mobile_menu.is(':hidden')) {
		mobile_veil.fadeIn('fast');
	}
	else {
		mobile_veil.fadeOut('fast');
	}
	mobile_menu.slideToggle(100);
	
	var pos = mobile_menu.offset();
	var gray_pos = pos.top;
	// If were beyond the breakpoint of a medium device, we need to adjust the background veil up by 1px
	if ($(window).width() >= medium_device_breakpoint) {
		gray_pos--;
	}

	mobile_veil.css({
		background: "linear-gradient(to bottom, rgba(0,0,0,0) 0%, rgba(0,0,0,0) " + gray_pos + "px, rgba(0,0,0,0.4) " + gray_pos + "px,rgba(0,0,0,0.4) 100%)",
		height: $(document).height() + "px"
	});
}